import Link from 'next/link';

const Navbar = () => {
  return (
    <nav>
      <div className="logo">
        <h1>Next JS Links</h1>
      </div>
      <Link href="/"><a>Link 1</a></Link>

      <Link href="/about"><a>Link 3</a></Link>
      <Link href="/ninjas/"><a>Link 3</a></Link>
    </nav>
);
}

export default Navbar;
